  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'ecommerce-app';
}
<nav>
  <ul>
       <li><a routerLink="/buscar-asociar-fondos">Administrar fondos</a></li>

